import React, { useState, useEffect } from 'react';
import confetti from 'canvas-confetti';

const App = () => {
  const [phase, setPhase] = useState('loading'); 
  const [progress, setProgress] = useState(0);
  const [noCount, setNoCount] = useState(0);
  const [noStyle, setNoStyle] = useState({});
  const [yesScale, setYesScale] = useState(1);
  const [quizStep, setQuizStep] = useState(0);
  const [showSidebar, setShowSidebar] = useState(false);

  useEffect(() => {
    if (phase === 'loading') {
      const interval = setInterval(() => {
        setProgress((prev) => {
          if (prev >= 99) {
            clearInterval(interval);
            setTimeout(() => {
              setPhase('prank');
              setShowSidebar(true);
            }, 1000);
            return 99;
          }
          return prev + 1;
        });
      }, 40);
      return () => clearInterval(interval);
    }
  }, [phase]);

  const moveNoButton = () => {
    const x = Math.random() * (window.innerWidth * 0.7);
    const y = Math.random() * (window.innerHeight * 0.7);
    setNoStyle({ 
      position: 'fixed', 
      left: `${x}px`, 
      top: `${y}px`, 
      transition: '0.2s ease-out',
      zIndex: 999 
    });
    setNoCount(noCount + 1);
    setYesScale(prev => prev + 0.15);
  };

  const handleQuiz = (isCorrect) => {
    if (isCorrect) {
      if (quizStep < 1) {
        setQuizStep(quizStep + 1);
      } else {
        triggerKisses();
      }
    } else {
      alert("‚ö†Ô∏è ERROR: Incorrect answer detected. Your boyfriend's heart just broke a little. Try again! üçã");
    }
  };

  const triggerKisses = () => {
    setPhase('success');
    const end = Date.now() + (5 * 1000);
    const frame = () => {
      confetti({
        particleCount: 5,
        angle: 60,
        spread: 55,
        origin: { x: 0, y: 0.8 },
        colors: ['#ff4d6d', '#ff0000', '#ff85a1']
      });
      confetti({
        particleCount: 5,
        angle: 120,
        spread: 55,
        origin: { x: 1, y: 0.8 },
        colors: ['#ff4d6d', '#ff0000', '#ff85a1']
      });
      if (Date.now() < end) requestAnimationFrame(frame);
    };
    frame();
  };

  return (
    <div style={styles.container}>
      {/* SIDEBAR - THE BOYFRIEND LOG */}
      <div style={{ ...styles.sidebar, left: showSidebar ? '0' : '-300px' }}>
        <h3 style={{color: '#fff', fontSize: '1.2rem'}}>BF Status Report</h3>
        <div style={styles.sidebarItem}>
          <p>Lateness: <b>Very</b></p>
          <p>Regret Level: <b>1000%</b></p>
          <p>Lemon Count: <b>{noCount}</b></p>
        </div>
        <hr style={{margin: '15px 0', opacity: 0.3}}/>
        <p style={{fontSize: '12px'}}>Note: Pressing "No" increases lemon farming hours by 10 per click.</p>
      </div>

      {/* PHASE 1: LOADING */}
      {phase === 'loading' && (
        <div style={styles.card}>
          <h2 style={styles.title}>Boyfriend Apology Loader</h2>
          <div style={styles.progressBarOuter}>
            <div style={{ ...styles.progressBarInner, width: `${progress}%` }} />
          </div>
          <p style={styles.text}>Scanning for forgiveness... {progress}%</p>
        </div>
      )}

      {/* PHASE 2: THE PRANK */}
      {phase === 'prank' && (
        <div style={styles.card}>
          <div style={{fontSize: '50px'}}>üçã</div>
          <h2 style={styles.title}>To my favorite human...</h2>
          <p style={styles.text}>I'm late, but will you still be my <b>Belated Valentine?</b></p>
          <div style={styles.buttonGroup}>
            <button 
              onClick={() => setPhase('quiz')} 
              style={{ ...styles.btnYes, transform: `scale(${yesScale})` }}
            >
              YES! (I'm the best gf)
            </button>
            <button 
              onMouseEnter={moveNoButton}
              onClick={moveNoButton}
              style={{ ...styles.btnNo, ...noStyle }}
            >
              No, keep farming lemons
            </button>
          </div>
        </div>
      )}

      {/* PHASE 3: THE QUIZ */}
      {phase === 'quiz' && (
        <div style={styles.card}>
          <h2 style={{...styles.title, color: '#ff9f1c'}}>‚ö†Ô∏è Final Forgiveness Test</h2>
          {quizStep === 0 ? (
            <div style={styles.quizBox}>
              <p style={styles.text}>Who is the luckiest guy alive to have you?</p>
              <button onClick={() => handleQuiz(true)} style={styles.quizBtn}>My Boyfriend (Sourav)</button>
              <button onClick={() => handleQuiz(false)} style={styles.quizBtn}>Some random guy</button>
              <button onClick={() => handleQuiz(false)} style={styles.quizBtn}>A literal lemon üçã</button>
            </div>
          ) : (
            <div style={styles.quizBox}>
              <p style={styles.text}>Where is my actual gift?</p>
              <button onClick={() => handleQuiz(false)} style={styles.quizBtn}>There is no gift</button>
              <button onClick={() => handleQuiz(true)} style={styles.quizBtn}>In his pocket / On the way!</button>
            </div>
          )}
        </div>
      )}

      {/* PHASE 4: SUCCESS */}
      {phase === 'success' && (
        <div style={styles.card}>
          <h1 style={{fontSize: '4rem'}}>üíã</h1>
          <h2 style={styles.title}>LOCK IN!</h2>
          <p style={styles.text}>Access Granted. I love you so much! <br/> Get ready for the real surprise! ‚ù§Ô∏è</p>
          <div style={{marginTop: '20px', fontSize: '10px', color: '#aaa'}}>PROPERTY OF THE WORLD'S BEST GF</div>
        </div>
      )}
    </div>
  );
};

const styles = {
  container: {
    height: '100vh', width: '100vw', display: 'flex',
    justifyContent: 'center', alignItems: 'center',
    backgroundColor: '#fff0f3', fontFamily: 'system-ui, sans-serif',
    textAlign: 'center', margin: 0, overflow: 'hidden', position: 'relative'
  },
  sidebar: {
    position: 'absolute', top: 0, width: '220px', height: '100%',
    backgroundColor: '#ff4d6d', padding: '30px 20px', color: 'white',
    boxShadow: '4px 0 15px rgba(0,0,0,0.1)', transition: '0.6s ease-in-out',
    textAlign: 'left', zIndex: 50
  },
  sidebarItem: { marginTop: '20px', fontSize: '14px', lineHeight: '1.8' },
  card: {
    padding: '40px', borderRadius: '30px', backgroundColor: 'white',
    boxShadow: '0 20px 40px rgba(0,0,0,0.1)', maxWidth: '400px',
    width: '90%', border: '3px solid #ffb3c1', zIndex: 10, position: 'relative'
  },
  title: { color: '#ff4d6d', margin: '10px 0', fontSize: '1.5rem', fontWeight: 'bold' },
  text: { color: '#555', marginBottom: '20px', fontSize: '1rem' },
  progressBarOuter: { width: '100%', height: '10px', backgroundColor: '#eee', borderRadius: '10px', margin: '20px 0' },
  progressBarInner: { height: '100%', backgroundColor: '#ff4d6d', borderRadius: '10px', transition: 'width 0.1s' },
  buttonGroup: { display: 'flex', flexDirection: 'column', alignItems: 'center', gap: '15px', marginTop: '20px' },
  btnYes: { padding: '12px 30px', backgroundColor: '#ff4d6d', color: 'white', border: 'none', borderRadius: '50px', cursor: 'pointer', fontWeight: 'bold' },
  btnNo: { padding: '10px 20px', backgroundColor: '#adb5bd', color: 'white', border: 'none', borderRadius: '10px', cursor: 'pointer' },
  quizBox: { display: 'flex', flexDirection: 'column', gap: '10px', marginTop: '10px' },
  quizBtn: { padding: '10px', backgroundColor: 'white', border: '2px solid #ffb3c1', borderRadius: '10px', cursor: 'pointer', color: '#ff4d6d', fontWeight: '600' }
};

export default App;
